import React from "react";
import {Navbar, Nav} from 'react-bootstrap';

import "../css/navbar.css"

export default class NavBar extends React.Component {
  render() {
    return (
      <div>
        <Navbar variant="dark" expand="xl" fixed="top" className="navbar navbar-static-top">
          <Navbar.Brand href="/">
            <Navbar.Text className="navbarTitle">Home</Navbar.Text>
          </Navbar.Brand>
          <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end px-2">
            <Nav>
              <Nav.Link href="/" className="link">Images</Nav.Link>
              <Nav.Link href="/" className="link">Media</Nav.Link>
              <Nav.Link href="/" className="link">Projects</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}
